import { useEffect } from "react";
import styled from "styled-components";
import { tmdAxios } from "../../api/tmdbAxios";
import TitleBox from "./ContentItem";
import ContentItem from "./TitleBox";

function ContentList({ title }) {
  useEffect(() => {
    tmdAxios.get("/trending/all/day");
  }, []);
  return (
    <Container>
      <TitleBox title={title} />
      <ItemList>
        <ContentItem />
        <ContentItem />
        <ContentItem />
      </ItemList>
    </Container>
  );
}

const Container = styled.div`
  padding: 10px 0;
`;

const ItemList = styled.ul`
  display: flex;
  margin-top: 20px;
`;

export default ContentList;
